Well, when I have heard stuff in spirit with respect to events, I 
have found that it doesn&#39;t seem to always line up with &quot;time&quot; as I 
know it.  

For example, I once heard regarding an organization, &quot;I&#39;m tearing it 
down.&quot; Of course, I thought that meant it was coming down 
imminently.  Well, that word from spirit was heard a decade ago, and 
the organization is still alive, although it is struggling and unable 
to grow.  I know I heard it, but I can&#39;t set a date to it, as I 
believe it is a process (in that example).

LC

